// 比赛结果类型
export enum matchType {
 homeWin = 1, //主胜
 draw, // 平局
 awayWin, // 客胜
}
// 比赛结果大小类型
export enum matchBallType {
 big = 1, //大
 small, // 小
 walk, // 走水
}
// 推送类型
export enum pusherType {
 mainPush = 1, // 主推
 minorPush = 2 // 次推
}
